    return (
        <Container fluid className="sec-container">
            <div className="header bold">Öğrenci Listesi</div>
            <VeriEkle callBack={callBack} detail={null} tid={-1}></VeriEkle>
        </Container>
    )
}


export default TableCardHeader;
